export const saveUser = (username, token) => {
    return {
        type : "SAVE_USER",
        payload : {
            username : username,
            token : token
        }
    }
}

export const loadLeaderboards = () => {
    return {
        type : "LOAD_LEADERBOARDS",
        payload : {}
    }
}

export const loadLeaderboardData = () => {
    return {
        type : "LOAD_LEADERBOARDS_DATA",
        payload : {}
    }
}
